import { Container, Button } from 'reactstrap';


import HomePageCarousel from '../components/HomePage/HomePageCarousel';

function Home() {
    return(
        <Container>
            <h1 className='text-center'>
                Welcome to PZ Cheeseria
            </h1>
            <div>
                <HomePageCarousel />                
            </div>
        </Container>
    );
}

export default Home;
